import React, { useEffect } from 'react'
import ProductCard from '../component/ProductCard'

const ProductDetail = ({item}) => {
  const getProductDetail = async()=>{
    let url = `http://localhost:3000/product/0`
  }
  useEffect(()=>{
    getProductDetail()
  },[])
  return (
    <div>
      <ProductCard />
    </div>
  )
}

export default ProductDetail
